import React, { useState } from "react";
import "./App.css";

function Collapsible() {
  const [IsOpen, setIsOpen] = useState(false);
  return (
    <div className="button" onClick={() => setIsOpen(!IsOpen)}>
      About us
    </div>
  );
}

export default Collapsible;
